import React, { Fragment } from 'react';

import Link from 'next/link'


const mainComponent = () => (
    <Fragment>
        <Link href={'/'}>
            <div>Hello world</div>
        </Link>
        <Link href={'/hey'}>
            <div>Hey</div>
        </Link>
    </Fragment>
);


export default mainComponent();
